// src/components/Footer.js

import React from 'react';
import ContactUs from './ContactUs';

function Footer() {
  return (
    <footer>
      <div>
        <h3>Footer Content</h3>
        {/* Other footer elements */}
      </div>

      {/* ContactUs form */}
      <div id="contact-us-footer">
        <ContactUs />
      </div>
    </footer>
  );
}

export default Footer;
